import React from "react";
import "./Checkbox.css"

const Checkbox = () => {
    return (
        <div>
            <h1 className="text-center display-6 bg-primary text-white p-3">Kayıt Formu</h1>

            <input type="checkbox" class="form-check-input" value="" id="flexCheckDefault"/>
            <label class="form-check-label" for="flexCheckDefault" placeholder="Sözleşme Koşullarını Kabul Et"/>
        </div>
    )
} 

export default Checkbox
